import{o as e,c as r,d as a}from"./app.7853f4dd.js";const t='{"title":"FAQ","description":"","frontmatter":{},"headers":[{"level":2,"title":"FAQ","slug":"faq"}],"relativePath":"faq.md","lastUpdated":1620188039148}',s={},o=a('<h2 id="faq"><a class="header-anchor" href="#faq" aria-hidden="true">#</a> FAQ</h2><h4 id="does-any-server-side-software-need-to-be-installed"><a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-hidden="true">#</a> Does any server side software need to be installed?</h4><p>For most of the TeamOne functionality no server side software is required to install. However if you install <strong>TeamOne Agent</strong> you will get additional features, like server health status data (RAM, CPU, disk size)</p><h4 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers"><a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-hidden="true">#</a> Will any of my data be sent or stored on any 3rd party servers?</h4><p>TeamOne stores temporary data using <a href="https://en.wikipedia.org/wiki/HTTP_cookie" target="_blank" rel="noopener noreferrer">cookies</a>. No data is being sent or stored on any servers.</p><h4 id="which-integratedsecuritymode-does-teamone-support"><a class="header-anchor" href="#which-integratedsecuritymode-does-teamone-support" aria-hidden="true">#</a> Which IntegratedSecurityMode does TeamOne support?</h4><p>For most functionality TeamOne supports all IntegratedSecurityMode options, however for users creation currently only <em>IntegratedSecurityMode=5</em> is supported and Cognos namespace must be named as <strong>LDAP</strong></p><hr><p>SucceediumÂ® 2021 | <a href="/contact.html">Contact Us</a> | <a href="/privacy.html">Privacy Policy</a> | <a href="/terms.html">Terms Of Service</a></p>',9);s.render=function(a,t,s,n,d,i){return e(),r("div",null,[o])};export default s;export{t as __pageData};
